def find_kth_largest_prime(arr, k):
    primes = []
    for num in arr:
        if num <= 2:
            continue
        is_prime = True
        for i in range(2, int(math.sqrt(num)) + 1):
            if num % i == 0:
                is_prime = False
                break
        if is_prime:
            primes.append(num)
    primes.sort(reverse=True)
    return primes[k - 1] if k <= len(primes) else None

